style.css:
@-moz-document domain("www.studocu.com") {
:root {
    --bg-color: #161f31;
    --bg-dark-color: #121928;
    --fg-color: #c9d8ee;
    --fg-dark-color: #a9bad6;
    --red-color: #ff3939;
    --orange-color: #ff9f39;
    --yellow-color: #ffea39;
    --purple-color: #d62ed6;
    --cyan-color: #42caca;
    --green-color: #64f923;
    --blue-color: #5889ff;
    --pink-color: #f36cde;
    --border-color: #e1e1e1;
    --none: none;
  }

  * {
    box-shadow: none;
  }

  div,
  dl,
  dt,
  dd,
  ul,
  ol,
  li,
  pre,
  label,
  fieldset,
  input,
  p,
  blockquote,
  th,
  td,
  i,
  i::before,
  font,
  body {
    color: var(--fg-color) !important;
  }
  pre[class^="language"],
  code {
    background: var(--bg-dark-color) !important;
    color: var(--fg-dark-color) !important;
  }

  h1,
  h2,
  h3,
  h4,
  h5,
  h6 {
    color: white !important;
  }

  ins {
    color: var(--green-color) !important;
    background: none !important;
  }

  del {
    color: var(--red-color) !important;
    background: none !important;
  }

  a {
    color: var(--pink-color);
    border: none !important;
  }

  a:link {
    color: var(--cyan-color);
  }

  a:hover *,
  a:hover {
    color: var(--orange-color) !important;
  }

  button {
    border: 1px solid var(--border-color) !important;
    background: black !important;
    color: var(--fg-color) !important;
  }

  button:hover {
    opacity: 0.8;
  }

  body {
    background: var(--bg-color);
  }

  table {
    border-collapse: collapse !important;
  }

  table,
  noscript,
  select,
  input,
  tr,
  td,
  th,
  option {
    border: 1px solid var(--border-color) !important;
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }

  #viewer-wrapper {
    background: var(--bg-color) !important;
  }

  #header-position-handle {
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }
  #sidebar-wrapper,
  #document-viewer-sidebar-wrapper,
  #sidebar {
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }
  #sidebar svg {
    color: var(--fg-color) !important;
  }

  ._f51c31cfd126,
  ._5dceeb060520 {
    background: black !important;
  }
  ._de225b4ca63c,
  ._376fb131f5ee,
  ._d55dd68f1373 {
    color: var(--fg-color) !important;
  }

  #sidebar-groups-link {
    border: 1px solid var(--border-color) !important;
    background: black !important;
    color: var(--fg-color) !important;
  }

  ._cf82ebcd47ba {
    filter: invert(1);
  }

  .page-content .c {
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }

  #sidebar-guest-avatar div div {
    border: 1px solid var(--border-color) !important;
  }

  #sidebar-guest-avatar div span {
    background: black !important;
    color: var(--fg-color) !important;
  }

  ._ab20de9d838c {
    background: black !important;
    color: var(--fg-color) !important;
  }

  ._115a24aa93fc {
    background: black !important;
    color: var(--fg-color) !important;
    border: 1px solid var(--border-color) !important;
  }
}
